import React, { Fragment } from 'react'
import s from '../css/connexion.module.css'

export default function Connexion() {
  return (
    <Fragment>
        <div className={`${s.connexion}`}>
            <div className={`${s.gauche}`}></div>
            <div className={`${s.droite}`}></div>
        </div>
    </Fragment>
  )
}
